import React, { useEffect } from 'react';
import './skill.css';
import * as THREE from 'three';

const Skill = () => {
	useEffect(() => {
		const scene = new THREE.Scene();
		const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);

		const canvas = document.querySelector('.homeCanvas');
		const renderer = new THREE.WebGLRenderer({ canvas });

		const geometry = new THREE.BoxGeometry(1, 1, 1);
		const material = new THREE.MeshBasicMaterial({ color: 0x00ff00 });

		const mesh = new THREE.Mesh(geometry, material);
		camera.position.z = 3;

		scene.add(mesh);
		const animate = () => {
			requestAnimationFrame(animate);
			mesh.rotation.y += 0.01;
			mesh.rotation.x += 0.01;
			renderer.setSize(window.innerWidth, window.innerHeight);
			renderer.render(scene, camera);
		};
		animate();
	}, []);

	return (
		<div className="skill">
			<canvas className="homeCanvas" />

			<div className="mySkill">
				<div className="heading">
					<h3>Skills</h3>
				</div>
				<div className="row">
					<div className="col">
						<div className="cubeSkills">
							<div className="cubeSkillFaces cubeSkillFace1">
								<img
									src="data:image/jpeg;base64,"
									alt="face1"
								/>
							</div>

							<div className="cubeSkillFaces cubeSkillFace2">
								<img
									src="data:image/jpeg;base64,"
									alt="face1"
								/>
							</div>

							<div className="cubeSkillFaces cubeSkillFace3">
								<img
									src="data:image/jpeg;base64,"
									alt="face1"
								/>
							</div>

							<div className="cubeSkillFaces cubeSkillFace4">
								<img
									src="data:image/jpeg;base64,"
									alt="face1"
								/>
							</div>

							<div className="cubeSkillFaces cubeSkillFace5">
								<img
									src="data:image/jpeg;base64,"
									alt="face1"
								/>
							</div>

							<div className="cubeSkillFaces cubeSkillFace6">
								<img
									src="data:image/jpeg;base64,"
									alt="face1"
								/>
							</div>
						</div>
						<div className="cubeShadow" />
					</div>
          <div className="col">
            <p></p>
          </div>
				</div>
			</div>
		</div>
	);
};
export default Skill;
